
USE PRN211_FeedbackAndQASystem


SET IDENTITY_INSERT Feedback ON;
SET DATEFORMAT dmy;
SET IDENTITY_INSERT Feedback OFF;

DROP PROCEDURE IF EXISTS InsertContainData;

GO
CREATE PROCEDURE InsertContainData
AS
BEGIN
    DECLARE @feedbackId INT = 1
    DECLARE @fbQuestionId INT = 1
    
    WHILE @feedbackId <= 30
    BEGIN
        WHILE @fbQuestionId <= 5
        BEGIN
            VALUES (@feedbackId, @fbQuestionId)
            
            SET @fbQuestionId = @fbQuestionId + 1
        END
        
        SET @feedbackId = @feedbackId + 1
        SET @fbQuestionId = 1
    END
END
GO 
EXEC InsertContainData

SET IDENTITY_INSERT Do ON;

SET IDENTITY_INSERT Do OFF;

DROP PROCEDURE IF EXISTS InsertResponseData;

GO 
CREATE PROCEDURE InsertResponseData
AS
BEGIN
    DECLARE @doId INT = 1
    DECLARE @fbQuestionId INT = 1
    DECLARE @selectedOptionId INT = 1
    
    WHILE @doId <= 437
    BEGIN
        WHILE @fbQuestionId <= 5
        BEGIN
            DECLARE @selectedOptionStartId INT = (@fbQuestionId - 1) * 4 + 1
            DECLARE @selectedOptionEndId INT = @fbQuestionId * 4
            
            SET @selectedOptionId = @selectedOptionStartId
            
            WHILE @selectedOptionId <= @selectedOptionEndId
            BEGIN
                VALUES (@doId, @fbQuestionId, @selectedOptionId)
                
                SET @selectedOptionId = @selectedOptionId + 1
            END
            
            SET @fbQuestionId = @fbQuestionId + 1
        END
        
        SET @doId = @doId + 1
        SET @fbQuestionId = 1
    END
END
GO

EXEC InsertResponseData
